$.fn.botany=function(){if(!this.hasClass("botany")||"UL"!=this.prop("tagName"))throw new Error("The target of $().botany must be a <ul> element with the class .botany");$(this).on("click","li, ul, .botany-open, .botany-closed",function(n){var e=$(n.target).closest("li"),o=$(e).children("ul");e.hasClass("open")?o.children().length>0?o.slideUp(function(){e.removeClass("open")}):e.removeClass("open"):o.children().length>0?o.slideDown(function(){e.addClass("open")}):e.addClass("open"),n.stopPropagation()})};